import React from 'react'

const TodoItem = (props) => {
  return (
    <div classname='todo-item'>
      <input type="checkbox" onChange={()=>props.completed(props.id)} />
      <p className='todo-item'>{props.item}</p>
    </div>
  )
}

export default TodoItem
